// src/components/IniciarSesion.js
import React, { useState } from 'react';

const IniciarSesion = () => {
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [error, setError] = useState('');

  const handleSubmit = (e) => {
    e.preventDefault();

    // Validar credenciales básicas (ejemplo simple)
    if (email === 'usuario@ejemplo.com' && password === 'password123') {
      alert('Inicio de sesión exitoso');
      // Aquí podrías redirigir al usuario a otra página, o realizar una acción posterior
    } else {
      setError('Correo o contraseña incorrectos');
    }
  };

  return (
    <div className="login-container">
      <h1>Iniciar Sesión</h1>
      <form onSubmit={handleSubmit}>
        <div>
          <label>Correo electrónico:</label>
          <input 
            type="email" 
            value={email} 
            onChange={(e) => setEmail(e.target.value)} 
            required
          />
        </div>
        <div>
          <label>Contraseña:</label>
          <input 
            type="password" 
            value={password} 
            onChange={(e) => setPassword(e.target.value)} 
            required
          />
        </div>
        {error && <p className="error">{error}</p>}
        <button type="submit">Iniciar Sesión</button>
      </form>
      {/* Formulario de Registro */}
      <div className="container-form">
        <form className="sign-up">
          <h2>Registrarse</h2>
          <span><strong>Use su correo electrónico para registrarse</strong></span>
          <div className="container-input">
            <ion-icon name="person-outline"></ion-icon>
            <input type="text" placeholder="Nombre" required />
          </div>
          <div className="container-input">
            <ion-icon name="mail-outline"></ion-icon>
            <input type="email" placeholder="Email" required />
          </div>
          <div className="container-input">
            <ion-icon name="lock-closed-outline"></ion-icon>
            <input type="password" placeholder="Password" required />
          </div>
          <button type="button" className="button">Registrarse</button>
        </form>
      </div>

      {/* Sección de bienvenida con botones para alternar */}
      <div className="container-welcome">
        <div className="welcome-sign-up welcome">
          <h3>Bienvenido</h3>
          <p>Si aún no tiene una cuenta registrese para acceder a todas las funciones del sitio</p>
          <button className="button" onClick={handleToggle}>
            Registrarse
          </button>
        </div>
        <div className="welcome-sign-in welcome">
          <h3>Bienvenido</h3>
          <p>Si ya tiene una cuenta, inicie sesión para acceder a todas las funciones del sitio</p>
          <button className="button" onClick={handleToggle}>
            Iniciar Sesión
          </button>
        </div>
      </div>
    </div>
    
  );
};

export default IniciarSesion;
